import React from 'react'
import PropTypes from 'prop-types'

const ViewDoc = props => {
  const { src } = props

  return <iframe className='register__iframe' src={src} />
}

export default ViewDoc

ViewDoc.propTypes = {
  src: PropTypes.string.isRequired
}

ViewDoc.defaultProps = {
  src: ''
}
